static void tup_free (VAL v) {
    TUP* tup = VTUP(v);
    if (tup) {
        for (TUPLEN i = 0; i < tup->size; i++) {
            decref(tup->cells[i]);
        }
        free(tup);
    }
}

static void tup_decref_outer(TUP* tup, size_t n) {
    ASSERT(tup);
    ASSERT(tup->size == n);
    if (tup->refs == 1) {
        free(tup);
    } else {
        for (size_t i = 0; i < n; i++) {
            incref(tup->cells[i]);
        }
        if (!--tup->refs) tup_free(MKTUP(tup,n));
    }
}

